webpackJsonp([0x6eaf17f7625c],{5404:function(t,e){t.exports={data:{post:{html:'<p>Hi, we\'re back on European turf. We got to experience first hand the <a href="http://scriptingnews.userland.com/backissues/2001/12/30#lb80afadc2c02a67a0b715b010c14523f">confusion</a> at airports that Dave mentioned. Actually, except for my shoes going through the sprectrometer (without me in them), getting through security was no big deal. </p>\n<p>Gotta run, the German New Year\'s Eve tradition <a href="http://german.about.com/library/weekly/aa010101a.htm">Dinner for One</a> is about to come on TV...</p>',fields:{title:"12 Hours to Confusion",date:"31 Dec 2001",url:"https://papascott.de/2001-12-31-12-hours-to-confusion/"}}},pathContext:{slug:"/2001-12-31-12-hours-to-confusion/",prev:{fields:{title:"Streptococci",date:"30 Dec 2001",slug:"/2001-12-30-streptococci/"}},next:{fields:{title:"Happy E-Day",date:"01 Jan 2002",slug:"/2002-01-01-happy-e-day/"}}}}}});
